import { Typography } from '@mui/material';
import '../../App.css';
import Header from '../utils/Header';

function LandingPage() {
  return (
    <div style={{ width: '100%' }}>
      <Header />
      <div style={{ width: '100%', paddingTop: 25 }}>
        <div style={{ top: 100, position: 'fixed' }}>
          <Typography component='h5' variant='h1' style={{ marginLeft: 25, width: '100%', fontFamily: 'Markazi' }}>Des solutions personnalisées</Typography>
          <Typography component='h5' variant='h2' style={{ marginLeft: 25, width: '100%', fontFamily: 'Markazi' }}>pour alléger vos mensualités</Typography>
        </div>
        <div style={{ display: 'flex', flexDirection: 'row', width: '100%' }}>
          <div style={{ width: '50%', marginRight: 25, display: 'flex', justifyContent: 'flex-end', alignItems: 'flex-end' }}>
      test  
          </div>
          <div style={{ width: '50%' }}>
            <img style={{ width: '100%', height: 'auto' }} alt="simplifiez vos finances" src={require('../../pictures/landingPagePeople.png')} />
          </div>
        </div>
      </div>
    </div>
  );
}

export default LandingPage;
